import logo_kalypse from "./uploads_k/logo_kalypse.png";
import { Link } from "react-router-dom";

const MenuNav = () => {
  return (
    <>
      <div className="contenedor_menu">
        <img src={logo_kalypse} width="200" className="logo" alt="Kalypse" />
      </div>
      <nav>
        <ul>
          <li>
            <Link to="./Main.js">KALYPSE</Link>
          </li>
          <li>
            <Link to="./LaMarque.js">LA MARQUE</Link>
          </li>
          <li>
            <Link to="./LaCollection.js">LA COLLECTION</Link>
          </li>
          <li>
            <Link to="./Acordeon.js">acordeon</Link>
          </li>
        </ul>
      </nav>
    </>
  );
};

export default MenuNav;
